import React from 'react';

function Sidebar() {
  return (
    <aside className="sidebar">
      <ul>
        <li>대시보드</li>
        <li>공정 현황</li>
        <li>리포트</li>
        <li>설정</li>
      </ul>
    </aside>
  );
}

export default Sidebar;
